import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import StudentLoginComponent from './components/pages/authentication/StudentLogin';
import TeacherLoginComponent from './components/pages/authentication/TeacherLogin';
import TeacherRegisterComponent from './components/pages/authentication/TeacherRegisterComponent';
import StudentRegisterComponent from './components/pages/authentication/StudentRegisterComponent';
import RoleSelection from './components/pages/authentication/Role';

import './App.css';

import SubscriptionsPage from './components/pages/subscription/Subscription';
import HomePage from './components/pages/home/StudentHome';
import History from './components/pages/history/History';
import LikedVideo from './components/pages/likedVideo/LikedVideo';
import StudentProfile from './components/pages/profile/StudentProfile';

import TeacherDashboard from './components/pages/home/TeacherHome';
import UploadVideo from './components/pages/uploadVideo/UploadVideo';
import TeacherProfile from './components/pages/profile/TeacherProfile';

import StudentSidebar from './components/sidebar/StudentSidebar';
import TeacherSidebar from './components/sidebar/TeacherSidebar';

function App() {
    const [isLoggedIn, setIsLoggedIn] = useState(false);
    const [role, setRole] = useState(null);

    useEffect(() => {
        // Check if user is logged in by inspecting localStorage or using a JWT library
        const token = localStorage.getItem('token');
        if (token) {
            // Decode token or extract role information
            const decodedToken = decodeToken(token);
            if (decodedToken && decodedToken.role) {
                setRole(decodedToken.role);
                setIsLoggedIn(true);
            }
        }
    }, []);

    const decodeToken = (token) => {
        // Example: Decode JWT token to get user information
        try {
            const decoded = jwt_decode(token);
            return decoded;
        } catch (error) {
            console.error('Error decoding token:', error);
            return null;
        }
    };

    return (
        <Router>
            <div className="App">
                {!isLoggedIn && (
                    <header>
                        {/* Header content */}
                    </header>
                )}

                <Routes>
                    <Route path="/auth/register/student" element={<StudentRegisterComponent setIsLoggedIn={setIsLoggedIn} />} />
                    <Route path="/auth/register/teacher" element={<TeacherRegisterComponent setIsLoggedIn={setIsLoggedIn} />} />
                    <Route path="/auth/login" element={<RoleSelection setIsLoggedIn={setIsLoggedIn} />} />
                    <Route path="/auth/login/student" element={<StudentLoginComponent setIsLoggedIn={setIsLoggedIn} />} />
                    <Route path="/auth/login/teacher" element={<TeacherLoginComponent setIsLoggedIn={setIsLoggedIn} />} />

                    {isLoggedIn && role === 'student' && (
                        <>
                            <Route path="/student/home" element={<HomePage />} />
                            <Route path="/student/subscriptions" element={<SubscriptionsPage />} />
                            <Route path="/student/history" element={<History />} />
                            <Route path="/student/likedvideos" element={<LikedVideo />} />
                            <Route path="/student/profile" element={<StudentProfile />} />
                            <StudentSidebar />
                        </>
                    )}

                    {isLoggedIn && role === 'teacher' && (
                        <>
                            <Route path="/teacher/home" element={<TeacherDashboard />} />
                            <Route path="/teacher/upload" element={<UploadVideo />} />
                            <Route path="/teacher/profile" element={<TeacherProfile />} />
                            <TeacherSidebar />
                        </>
                    )}

                    <Route path="*" element={<Navigate to="/auth/login" />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
